import { useNavigate} from "react-router-dom";
import { useEffect } from "react";

function Home() {
    useEffect(()=>{
        const count = localStorage.getItem("pageCount");
        if(!count){
            localStorage.setItem("pageCount",1);
        }else{
            localStorage.setItem("pageCount",parseInt(count)+1);
        }
        console.log(count)
    },[])
    const navigate = useNavigate();
    const pages = ["Contact","About"]
  return (

    <div className="Home">
        <h1>HOME PAGE</h1>
        <div className="nav" style={{display:"flex"}}>
             {pages.map(el=><p style={{marginRight:"10px",cursor:"pointer" }} onClick={()=>navigate(`/${el.toLocaleLowerCase()}`)}>{el}</p>)}
        </div>
        <p>Banner: B00934148</p>

    </div>
  );
}

export default Home;
